import { NavTop, OpenPanel } from "../../components";
import { Body, LeftPane, RightPane } from "./styles";

const Home = () => {
  return (
    <>
      <NavTop />
      <Body>
        <LeftPane>
          <OpenPanel title={"King 1 Bed"} />
        </LeftPane>
        <RightPane></RightPane>
      </Body>
    </>
  );
};

export default Home;
